/*!50003 CREATE DEFINER=`ncsoftwa_re`@`%` PROCEDURE `ClientesFallidas_BorrarByAccion`(
in p_accion varchar(20)
)
BEGIN
DELETE FROM clientesfallidas
where Accion = p_accion
;
END */$$
DELIMITER ;

